using System;
using System.Drawing;
using System.IO;
using System.Windows.Forms;
using Timer = System.Timers.Timer;

namespace Text2DragAndDrop
{
    public partial class Text2DragAndDropDialog : Form
    {
        private string _filename;
        public Text2DragAndDropDialog()
        {
            InitializeComponent();

            pictureBox1.AllowDrop = true;

            var pic = Convert.FromBase64String(_image);
            using (MemoryStream ms = new MemoryStream(pic))
            {
                pictureBox1.Image = Image.FromStream(ms);
            }
        }

        private void pictureBox1_MouseDown(object sender, MouseEventArgs e)
        {
            try
            {
                var tempFileName = Path.Combine(Path.GetTempPath(), filename.Text);
                _filename = tempFileName;
                File.WriteAllText(_filename, clipboard.Text);

                DataObject d = new DataObject();
                d.SetData(DataFormats.FileDrop, new[] { _filename });
                pictureBox1.DoDragDrop(d, DragDropEffects.Copy);
                Close();
            }
            finally
            {
                var timer = new Timer(10000);
                timer.Elapsed += (o, args) =>
                {
                    if (File.Exists(_filename))
                    {
                        File.Delete(_filename);
                    }

                    timer.Stop();
                    timer.Dispose();
                };
                timer.Start();
            }
        }

        public void ZeigeDialog()
        {
            clipboard.Text = Clipboard.GetText();
            ShowDialog();
        }

        private void Text2ClippyFile_Load(object sender, EventArgs e)
        {
            if (string.IsNullOrWhiteSpace(clipboard.Text))
            {
                Close();
            }
            else
            {
                filename.SelectionStart = 4;
                filename.SelectionLength = 0;
            }
        }

        private string _image =
            "";
    }
}